script: |
  super -f text -I q9708.spq | sort > q9708.out

inputs:
  - name: q9708.spq
    data: |
      SELECT - col1 * 11 + col1 AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT + ( - col1 ) = + col0 * - 8;
  - name: tab0

outputs:
  - name: q9708.out
    data: |
      -10
      -210
      -810
